import { Component, OnInit } from '@angular/core';
import { TranslateService } from '@ngx-translate/core';
import { environment } from '../environments/environment';
import { registerLocaleData } from '@angular/common';
import localeEn from '@angular/common/locales/en';
import { PetModel } from './features/pet/models/pet.model';
import { Router } from '@angular/router';
import { AccountModel } from 'app/features/login/models/account.model';
import { AccountStore } from 'app/features/login/store/account.store';
import { APP_VERSION } from 'app/app.constants';
import { StoreUtil } from 'app/shared/store/store-util';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss'],
})
export class AppComponent implements OnInit {
  account: AccountModel;
  title = 'angular-starter-kit';
  locale: string;
  pets: PetModel[] = [];

  constructor(
    private readonly translateService: TranslateService,
    private readonly accountStore: AccountStore,
    private readonly router: Router
  ) {
    this.locale = environment.defaultLanguage;
    this.translateService.use(environment.defaultLanguage);

    // Configure translation for app
    registerLocaleData(localeEn, 'en');

    translateService.setDefaultLang(environment.defaultLanguage);

    this.accountStore.getAccount().subscribe((account) => (this.account = account));
  }

  ngOnInit(): void {
    if (!environment.production) {
      StoreUtil.enableDevTools();
      window.app = APP_VERSION;
    }
  }

  changeLocale(): void {
    this.translateService.use(this.locale);
  }

  logout(): void {
    StoreUtil.clearStores();
    this.router.navigate(['login']);
  }
}

import { Component, EventEmitter, Input, Output } from '@angular/core';

@Component({
  selector: 'app-button',
  template: `
    <div class="list-item">
      <button type="button" [ngClass]="classes" (click)="clicked.emit($event)">{{ label }}</button>
    </div>
  `,
})
export class ButtonComponent {
  @Input() label = 'default label';
  @Input() primary = false;
  @Input() outlined = false;
  @Input() colorClass: 'info' | 'success' | 'danger' | 'warning' | 'light';
  @Input() size: 'sm' | 'xs' | 'lg' = 'xs';

  @Output() clicked: EventEmitter<Event> = new EventEmitter<Event>();

  public get classes(): string[] {
    const mode = this.primary ? 'btn-primary' : 'btn-secondary';
    const color = this.colorClass ? `btn-${this.colorClass}` : null;
    const outlinedMode = this.outlined ? `btn-outline-${this.colorClass}` : null;

    const classes = ['btn', `btn-${this.size}`];
    if (outlinedMode) {
      classes.push(outlinedMode);
    } else if (color) {
      classes.push(color);
    } else if (mode) {
      classes.push(mode);
    }

    return classes.filter((className) => Boolean(className));
  }
}

import { Component } from '@angular/core';
