import { tap } from 'rxjs';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
})
export class LoginComponent {
  username: string;
  password: string;

  constructor(
    private readonly loginService: LoginService,
    private readonly accountStore: AccountStore,
    private router: Router
  ) {}

  authenticate() {
    this.loginService
      .authenticate(this.username, this.password)
      .pipe(tap((account) => this.accountStore.setAccount(account)))
      .subscribe(() => {
        this.router.navigate(['pets']);
      });
  }
}

import { Component } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { Pet } from 'app/shared/api';
import { map, Observable } from 'rxjs';
import { AccountStore } from 'app/features/login/store/account.store';
import { PetsStore } from 'app/features/pet/store/pets.store';

@Component({
  selector: 'app-pet',
  templateUrl: './pet.component.html',
})
export class PetComponent {
  pet: Pet;
  accountFullName$: Observable<string>;
  constructor(
    route: ActivatedRoute,
    private readonly petsStore: PetsStore,
    private readonly accountStore: AccountStore
  ) {
    route.params.subscribe((params) => {
      if (params.id) {
        this.petsStore.findById(params.id).subscribe((pet) => (this.pet = pet));
      }
    });

    this.accountFullName$ = accountStore
      .getAccount()
      .pipe(map((account) => `${account.firstName} ${account.lastName}`));
  }
}

import { Component, OnInit } from '@angular/core';
import { Pet, PetService } from 'app/shared/api';
import { PetsStore } from 'app/features/pet/store/pets.store';
import { tap } from 'rxjs';

@Component({
  selector: 'app-pet-list',
  templateUrl: './pet-list.component.html',
})
export class PetListComponent implements OnInit {
  pets: Pet[];
  status: 'available' | 'pending' | 'sold' = 'pending';
  constructor(private readonly petsStore: PetsStore, private readonly petService: PetService) {}

  ngOnInit(): void {
    this.loadPets();
  }

  selectStatus(): void {
    this.loadPets();
  }

  loadPets(): void {
    this.petService
      .findPetsByStatus(this.status)
      .pipe(tap((pets) => this.petsStore.setPets(this.status, pets)))
      .subscribe((pets) => (this.pets = pets));
  }
}

